const alchemyEndpoint = `https://polygon-mumbai.g.alchemy.com/v2/${process.env.API_KEY}`;

const main = async () => {
  const contractAddress = "0x126FDcf54223C5DF0068E4796e6209aDD3992c8F";
  const contractABI = abi.abi;
  const provider = new ethers.providers.JsonRpcProvider(alchemyEndpoint);

  const privateKey = process.env.PRIVATE_KEY;
  const wallet = new ethers.Wallet(privateKey, provider);
  const domainContract = new ethers.Contract(
    contractAddress,
    contractABI,
    wallet
  );

  let balance = await provider.getBalance(domainContract.address);
  console.log(ethers.utils.formatEther(balance));
  // const tx = await domainContract.withdraw();
  // console.log(`Transaction hash: ${tx.hash}`);
  // await tx.wait();
  // console.log(`Transaction confirmed: ${tx.hash}`);

  // balance = await provider.getBalance(domainContract.address);
  // console.log(ethers.utils.formatEther(balance));
};

const runMain = async () => {
  try {
    await main();
    process.exit(0);
  } catch (error) {
    console.log(error);
    process.exit(1);
  }
};

runMain();
